import React, { Fragment } from 'react';
import { makeStyles } from "@material-ui/core/styles";
import styles from "assets/jss/material-kit-react/views/loginPage.js";
import styles1 from "assets/jss/material-kit-react/views/profilePage.js";

import Header from 'components/Header/Header';
import HeaderLinks from 'components/Header/HeaderLinks';
import GridContainer from 'components/Grid/GridContainer';
import GridItem from 'components/Grid/GridItem';
import profile from "../../assets/img/faces/christian.jpg";
import './ProfesionalesPreview.style.scss';
import CustomInput from 'components/CustomInput/CustomInput';
import Card from 'components/Card/Card';
import CardHeader from 'components/Card/CardHeader';
import CardBody from 'components/Card/CardBody';
import CardFooter from 'components/Card/CardFooter';
import { Button } from 'primereact/button';

const useStyles = makeStyles(styles,styles1);


const ProfesionalesPreview = (props) => {
    const classes = useStyles();
    

    const [cardAnimaton, setCardAnimation] = React.useState("cardHidden");
        setTimeout(function () {
        setCardAnimation("");
    }, 700);

    const { ...rest } = props;

    const imageClasses = classNames(
        classes1.imgRaised,
        classes1.imgRoundedCircle,
        classes1.imgFluid
      );

    return (
        <>
          <Header
            fixed
            color="white"
            brand=""
            rightLinks={<HeaderLinks />}
            {...rest}
          />

<div
        className={classes.pageHeader}
        style={{
          backgroundColor: "white",
          backgroundSize: "cover",
          backgroundPosition: "top center"
        }}
      >
          <div className={classes.container}>
          <GridContainer justify="center">
            <GridItem xs={12} sm={12} md={3}>
              <h4 className="titulo4">PREPARA TU ENTREVISTA</h4>              
              <span className="span">Profesionales a tu disposición</span>
            </GridItem>
            <GridItem xs={12} sm={12} md={9}>
            <label id="color">Filtrar por:</label>
              <div className="filtrar">               
                <CustomInput
                    labelText="Sector"
                    id="sector"
                    formControlProps={{
                        fullWidth: false
                    }}
                    inputProps={{
                        type: "text",                        
                        autoComplete: "on"
                    }}
                />

                <CustomInput
                    labelText="Precio"
                    id="precio"
                    formControlProps={{
                        fullWidth: false
                    }}
                    inputProps={{
                        type: "text",                        
                        autoComplete: "on"
                    }}
                />

<               CustomInput
                    labelText="Idioma"
                    id="idioma"
                    formControlProps={{
                        fullWidth: false
                    }}
                    inputProps={{
                        type: "text",                        
                        autoComplete: "on"
                    }}
                />

                <CustomInput
                    labelText="Tipo"
                    id="tipo"
                    formControlProps={{
                        fullWidth: false
                    }}
                    inputProps={{
                        type: "text",                        
                        autoComplete: "on"
                    }}
                />

                <CustomInput
                    labelText="Hashtag"
                    id="hashtag"
                    formControlProps={{
                        fullWidth: false
                    }}
                    inputProps={{
                        type: "text",                        
                        autoComplete: "on"
                    }}
                />                    
              </div>
            </GridItem>
            </GridContainer>
      </div>
      
      <div className={classes.container}>
          <GridContainer justify="center">           

            <GridItem xs={12} sm={12} md={5}>
              <Card id="cardProf" className={classes[cardAnimaton]}>
                <form className={classes.form}>
                  <CardHeader color="primary" className={classes.cardHeader}>
                    <h4>Crea tu perfil</h4>                    
                  </CardHeader>
                  <p className={classes.divider}>O inscripción vía email</p>
                  <CardBody>
                  <div className={classes.profile}>
                  <div>
                    <img src={profile} alt="..." className={imageClasses} />
                  </div>
                  <div className={classes.name}>
                    <h3 className={classes.title}></h3>
                  </div>
                  </div>
                  </CardBody>
                  <CardFooter className={classes.cardFooter}>
                    <Button simple color="primary" size="lg">
                      Inscríbete
                    </Button>
                  </CardFooter>
                </form>
              </Card>
            </GridItem>
          </GridContainer>
        </div>
      
      
      </div>

         </> )



}

export default ProfesionalesPreview
